import React from 'react';

const Home = () => {
    return (
        <div style={{ textAlign: 'center', padding: '20px', color: 'white' }}>
            <h1>Welcome to Troop Formation Calculator</h1>
            <p>
                Plan and optimize your troop formations for battle success. Create, save, and manage your strategies. 
                Get started by registering or logging in to access your saved formations!
            </p>
        </div>
    );
};

export default Home;
